css:
status-bar {
  display: block;
  font-size: 11px;
  line-height: 22px;
  height: 26px;
  position: relative;
  -webkit-user-select: none;
  cursor: default;
  overflow: hidden;
  white-space: nowrap;
  min-width: -webkit-min-content;
}
status-bar .flexbox-repaint-hack {
  padding: 0 12.5px;
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
}
status-bar .icon:before {
  font-size: 14px;
  width: 14px;
  height: 14px;
  position: relative;
  top: 1px;
  margin-right: 0px;
}
status-bar .icon-diff-ignored:before,
status-bar .commits-ahead-label:before,
status-bar .commits-behind-label:before {
  margin-right: -1px;
}
status-bar .buffer-modified:empty,
status-bar .current-path:empty,
status-bar .cursor-position:empty,
status-bar .selection-count:empty {
  display: none;
}
status-bar .git-view {
  display: inline-block;
}
